import React from 'react';

const signin=()=>{
	return(
		<div>
			<div class="card blue-grey darken-1">
		        <h1>Instagram</h1>
		        <input>Email</input>
		        <input>Password</input>
	      </div>
		</div>
		)

}

export default signin
